import React from 'react'
import HomePage from "../components/PrincipalPages/HomePage";
import CouchList from "../components/PrincipalPages/CouchList";
import Login from "../components/PrincipalPages/Login";
import Register from "../components/PrincipalPages/Register";
import CouchDetail from "../components/PrincipalPages/CouchDetail";
import { createBrowserRouter } from "react-router-dom";

export const primaryRoute = createBrowserRouter([
  {
    path: "/",
    element: <HomePage />,
  },
  {
    path: "/list",
    element: <CouchList />,
  },
  {
    path: "/login",
    element: <Login />,
  },
  {
    path: "/register",
    element: <Register />,
  },
  {
    path: "/detail",
    element: <CouchDetail />,
  },
]);
